import React from "react";
import { Col, Row } from "react-bootstrap";
import a from "./img/a.jpg";
import b from "./img/b.jpg";
import c from "./img/c.jpg";

const Team = (props) => {
    return (
        <div className=" bg-dark">
            <img src={props.img} alt={props.alt} />
            <h1>{props.name}</h1>
            <p>{props.summ}</p>
        </div>
    )
}

const OurTeam = () => {
    return ( 
        <div>
            <Row>
                <Col>
                    <Team img={a} name="img1" summ="fdsfdsfsfsf" alt="firstimg" />
                </Col>
                <Col>
                    <Team img={b} name="img2" summ="fdsfdsfsfsf" alt ="secondimg" />
                </Col>
                <Col>
                    <Team img={c} name="img3" summ="fdsfdsfsfsf" alt="thirdimg" />
                </Col>
            </Row>
        </div>
     );
}

export default OurTeam;
